import styles from "./AdminDashboardStyleSheet";
import { Image, Text, View, SafeAreaView } from "react-native";
import Carousel from "react-native-snap-carousel";

export default class AdminDashboard extends React.Component {
  static navigationOptions = ({ navigation }) => {
    const { params = {} } = navigation.state;
    return {
      header: null,
      headerLeft: null,
      headerRight: null,
    };
  };

  constructor(props){
  super(props);

	this.state = {
	  activeIndex:0,
	  carouselItems: [
	  {
		  title:"Create Job",
		  text: "Create a Job",
      image:require("C:\\Users\\Edeki Okoh1\\Desktop\\Modellytics\\Mobile\\EyeQ\\assets\\images\\group-15.png"),
      link: 'CreateJobs1'
	  },
	  {
		  title:"Edit Job",
		  text: "Edit a Job",
      image:require("C:\\Users\\Edeki Okoh1\\Desktop\\Modellytics\\Mobile\\EyeQ\\assets\\images\\group-15.png"),
      link: 'CreateJobs1'
	  },
	  {
		  title:"View Job",
		  text: "View Job Details",
      image:require("C:\\Users\\Edeki Okoh1\\Desktop\\Modellytics\\Mobile\\EyeQ\\assets\\images\\group-15.png"),
      link: 'CreateJobs1'
	  },
	  {
		  title:"Reports",
		  text: "View Reports",
      image:require("C:\\Users\\Edeki Okoh1\\Desktop\\Modellytics\\Mobile\\EyeQ\\assets\\images\\group-15.png"),
      link: 'CreateJobs1'
	  },
	  {
		  title:"Messaages",
		  text: "View Messages",
      image:require("C:\\Users\\Edeki Okoh1\\Desktop\\Modellytics\\Mobile\\EyeQ\\assets\\images\\group-15.png"),
      link: 'CreateJobs1'
	  },
	]
  }
  }

_renderItem({item,index}){
	return (
    <View   onPress = {() => navigation.navigate('CreateJobs1')}
     style={{
		  backgroundColor: "#5574F7",
      borderRadius: 5,
      borderColor:'black',
      borderWidth:2,
		  height: 150,
		  padding: 50,
		  marginLeft: 25,
      marginRight: 25, }}
    >
		<Text style={{fontSize: 25, color:'white', paddingLeft:25}}>{item.title}</Text>
		<Text style = {{color:'white', paddingLeft:25}}>{item.text}</Text>
		<Image style = {{top:-39, left:-20}} source={item.image} />
	  </View>

	)
}

  componentDidMount() {

  }



