            <Image
              source={require("C:\\Users\\Edeki Okoh1\\Desktop\\Modellytics\\Mobile\\EyeQ\\assets\\images\\ic-chrome-reader-mode-24px.png")}
              style={styles.icChromeReaderModImage}
